import React from 'react';
import '../styles/Home.css';

class Home extends React.Component {
  render() {
    return (
      <div className="Home">
        <h1>Welcome to Techbitz</h1>
        <p>We provide the following services: web development, app development, digital context creation, ads creation, and testing framework provision.</p>
      </div>
    );
  }
}

export default Home;
